import React from 'react'
import {Card,Table,Button,Icon} from "antd"
import "./category.less"
import LinkButton from "../../components/link-button";

export default class Category extends React.Component {
    render(){
        const title = "一级分类列表";
        const extra = (
            <Button type="primary">
                <Icon type="plus"/>添加
            </Button>
        )

        const dataSource = [
            {
                "parentId": '0',
                "_id": '5ca9d69',
                "name": '家用电器',
                "_v":0
            },{
                "parentId": '0',
                "_id": '5ca9d6c',
                "name": '电脑',
                "_v":0
            },{
                "parentId": '0',
                "_id": '5ca9d7c',
                "name": '图书',
                "_v":0
            },{
                "parentId": '0',
                "_id": '5ca9dbe',
                "name": '服装',
                "_v":0
            }

        ];

        const columns = [
            {
                title: '分类名称',
                dataIndex: 'name',
                key: 'name',
            },
            {
                title: '操作',
                dataIndex: '',
                key: 'x',
                render:()=>(<span>
                    <LinkButton>修改分类</LinkButton>
                    <LinkButton>查看子分类</LinkButton>
                </span>)
            }

        ];


        return (
            <Card title={title} extra={extra}>
                <Table bordered dataSource={dataSource} columns={columns} />;
            </Card>
        )
    }
}
